import React from 'react';
import { View, Text, TextInput, TouchableOpacity, StyleSheet, ImageBackground } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import GymScreen from './Gym/GymScreen';
import SelectDateScreen from './Gym/SelectDateScreen';
import MainScreenComponent from './MainScreenComponent';
import Lostmain from './Lost/Lostmain';
import { widthPercentageToDP as wp, heightPercentageToDP as hp } from 'react-native-responsive-screen';

const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();

const MainScreen = ({ navigation }) => {
  return (
    <View style={styles.container}>
     
      <View style={styles.headerContainer}>
        <View style = {styles.imageContainer}>
          <ImageBackground
            source={require('./../assets/GWNU-LOGO.png')} // 이미지를 로컬 'assets' 폴더에서 불러옴
            style={styles.imageStyle}
            resizeMode="contain"
          >
          </ImageBackground>
        </View>

        <View style = {styles.textContainer}>
          <Text style={styles.textStyle}>국립 강릉원주대학교</Text>
          <Text style={styles.subHeader}>GANGNEUNG-WONJU NATIONAL UNIVERSITY</Text>
        </View>
        <View style={styles.spacer}/>
      </View>

      <View style={styles.bodyContainer}>
        <View style = {styles.bodyTopContainer}>
          <Text style={styles.bodyTopText}>
            원주 캠퍼스
          </Text>
        </View>

        <View style = {styles.bodyMiddleContainer}>
          <View style={styles.loginFormContainer}>
            <TextInput
              style={styles.input}
              placeholder="아이디"
            />
            <TextInput
              style={styles.input}
              placeholder="비밀번호"
              secureTextEntry={true}
            />
            <TouchableOpacity
              style={styles.loginButton}
              onPress={() => navigation.navigate('MainScreenComponent')}
            >
              <Text style={styles.loginButtonText}>로그인</Text>
            </TouchableOpacity>

            <TouchableOpacity
              style={styles.signupButton}
            >
            <Text style={styles.signupButtonText}>회원가입</Text>
            </TouchableOpacity>
          </View>
        </View>

        <View style = {styles.bodyBottomContainer}/>
      </View> 
        
      
      
      
      
      <View style={styles.bottomImageContainer}>
        <ImageBackground
            source={require('./../assets/teamLogo.png')} // 이미지를 로컬 'assets' 폴더에서 불러옴
            style={styles.bottomImageStyle}
            
        >
        </ImageBackground>
      </View>
    </View>
    
  );
};

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Main">
        <Stack.Screen
          name="Main"
          component={MainScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="MainScreenComponent"
          component={MainScreenComponent}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="GymScreen"
          component={GymScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="SelectDateScreen"
          component={SelectDateScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen 
          name="Lostmain" 
          component={Lostmain} 
          options={{ headerShown: false }} 
        />

      </Stack.Navigator>
    </NavigationContainer>

    
  );

};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },

  //헤더 컨테이너 이미지, 텍스트
  headerContainer: {
    
    backgroundColor: 'rgb(0, 150, 200)',
    width: '100%',
    height: hp('15%'),
    position: 'absolute',
    flexDirection: 'row',
    top: 0,
    alignItems: 'center',
    justifyContent: 'center',
  },
  
  imageContainer: {
    width: wp('20%'),
    left: wp('4%'),

  },
  imageStyle: {
    top: hp('2%'),
    width: wp('15%'),
    height:hp('7%'),
  },


 textContainer: {
    width: wp('60%'),
    alignItems: 'center',
    
 },

  textStyle: {
    fontSize: hp('3%'), 
    top: hp('2%'), 
    fontWeight: 'bold',
    alignItems: 'center',
    
  },
  spacer: {
    width: wp('20%'),
  },


  subHeader: {
    fontSize: hp('1%'), 
    top: hp('3%'), 
    fontWeight: 'bold',
    color: 'white',
  },

//여기부터 로그인 컨테이너

bodyContainer: {
  height: hp('70%'),
  width: wp('100%'),
  backgroundColor: '#f0f0f0', 
},

bodyTopContainer: {
  backgroundColor: '#f8f9fa',
  height: hp('15%'),
  flexDirection: 'column',
  justifyContent: 'center', 
  alignItems: 'center', 
},

bodyTopText: {
  fontStyle: 'italic',
  fontWeight: 'bold',
  textAlign: 'center',
  color: '#343a40', 
  fontSize: 18, 
},

bodyMiddleContainer: {
  height: hp('40%'),
  backgroundColor: '#f8f9fa',
  justifyContent: 'center', 
  paddingHorizontal: wp('10%'), 
},

loginFormContainer: {
  alignItems: 'center',
},

input: {
  width: '100%',
  padding: 15,
  marginBottom: 15,
  borderRadius: 10,
  backgroundColor: 'white',
  borderWidth: 1,
  borderColor: '#ced4da', 
},

loginButton: {
  width: '100%',
  padding: 15,
  borderRadius: 10,
  backgroundColor: '#343a40', 
  alignItems: 'center',
  justifyContent: 'center',
  borderWidth: 1,
  borderColor: '#ced4da',
},

loginButtonText: {
  color: 'white',
  fontSize: 16,
  fontWeight: 'bold',
},
//회원가입
signupButton: {
  backgroundColor: '#007bff',
  borderRadius: 10,
  paddingVertical: 10,
  alignItems: 'center',
  marginTop: 10,
  width: '100%',
},

signupButtonText: {
  color: 'white', 
  fontSize: 14,
  fontWeight: 'bold',
},

// 바디 밑 부분
bodyBottomContainer: {
  height: hp('15%'),
  backgroundColor: '#f8f9fa',
  justifyContent: 'center', 
  alignItems: 'center', 
},


  //팀 로고 이미지 컨테이너
  bottomImageContainer: {
    
    position: 'absolute',
    bottom: 0,
    width: '100%',
    alignItems: 'center',
    justifyContent: 'center',
    height: hp('15%'),
    backgroundColor: '#f8f9fa',
  },

  bottomImageStyle: {
    width: wp('40%'),
    height: hp('20%'),
  },

});

export default App;
